def determine_date_decision(N, messages):
    days = {}

    def findNum(data):
        multiplier = 1
        if data[0] == 'G':
            multiplier = 2
        lst = [int(s) for s in data.split() if s.isdigit()]
        for i in lst:
            if i not in days:
                days[i] = 1 * multiplier
            else:
                days[i] += 1 * multiplier
    for message in messages:
        findNum(message)
    max_key = 1
    max_value = 0
    max_count = 0
    for (day, weight) in days.items():
        if weight > max_value:
            max_key = day
            max_value = weight
            max_count = 1
        elif weight == max_value:
            max_count += 1
    if max_count > 1:
        return 'No Date'
    elif max_key == 19 or max_key == 20:
        return 'Date'
    else:
        return 'No Date'

